import Productpage from './components/Productpage';
import LoginPage from './components/LoginPage'; //



const App = () => {
  return (
    <Router>
      <div>
        <Routes>
          <Route path="/" element={<Homepage />} />
          <Route path="/products" element={<Productpage />} />    
        </Routes>
      </div>
    </Router>
  );
};

export default App;
